// src/App.js
import "./index.css";
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";

import Sidebar from "./components/Sidebar";
import Navbar from "./components/Navbar";
import ClientList from "./components/ClientList";
import ClientForm from "./components/ClientForm";
import ClientDetail from "./components/ClientDetail";
import PropertiesList from "./components/PropertyList";
import PropertyDetail from "./components/PropertyDetail";
import ClientPropEngine from "./components/ClientPropEngine";
import OrderList from "./components/OrderList";
import ActivitiesList from "./components/ActivitiesList";
import Informes from "./components/Informes";
import Marketing from "./components/Marketing";
import Questionaries from "./components/Questionaries";
import CreateInstanceSelector from "./components/CreateInstanceSelector";

export default function App() {
  return (
    <Router>
      <div className="flex flex-col h-screen">
        <Navbar />
        <div className="flex h-[calc(100vh-4rem)]">
          <Sidebar />
          <div className="w-5/6 p-6 overflow-auto">
            <Routes>
              <Route path="/clientes" element={<ClientList />} />
              <Route path="/clientes/nuevo" element={<ClientForm />} />
              <Route path="/clientes/:id" element={<ClientDetail />} />
              <Route path="/inmuebles" element={<PropertiesList />} />
              <Route path="/inmuebles/:id" element={<PropertyDetail />} />
              <Route path="/motor-cruce" element={<ClientPropEngine />} />
              <Route path="/solicitudes" element={<OrderList />} />
              <Route path="/actividades" element={<ActivitiesList />} />
              <Route path="/informes" element={<Informes />} />
              <Route path="/marketing" element={<Marketing />} />
              <Route path="/cuestionarios" element={<Questionaries />} />
              <Route path="*" element={<ClientList />} />
              <Route path="/crear" element={<CreateInstanceSelector />} />
            </Routes>
          </div>
        </div>
      </div>
    </Router>
  );
}
